import React from 'react';

const TodoList = (props) => {
    const deleteTodo = () => {
        console.log(props.list);
    }
    return (
        <>
            <div className='todo_style'>
                <i class="fa fa-times" aria-hidden="true" 
                    onClick={deleteTodo}
                />
                <li> {props.text} </li>
            </div>
        </>
    );
}

export default TodoList;
